\Huge
Most topic models use symmetric Dirichlet priors with fixed concentration parameters, with the implicit assumption that such "smoothing parameters" have little practical effect.\\
\vspace{1em}
We compare several classes of structured priors:
\vspace{0.5em}
\begin{itemize}
\item[$\bullet$] Best choice: asymmetric prior for document-specific topic distributions, symmetric prior for topic-specific word distributions
\end{itemize}
\vspace{1em}
Advantages:
\vspace{0.5em}
\begin{itemize}
\item[$\bullet$] Increased robustness to variations in the number of topics
\item[$\bullet$] Better handling of skewed word frequenices from high probability domain-specific words (e.g., "data", "model", "results" \ldots)
\item[$\bullet$] Can be approximated using efficient algorithms that add negligible cost beyond standard inference techniques
\end{itemize}
